import { makeStyles } from '@material-ui/styles';

const classes = makeStyles({
  paper: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    marginTop: '10',
  },
  form: {
    width: '100%',
    marginTop: '3',
  },
});

export default classes;
